interface UserItemProps {
    id: number; 
    userName: string;
    userLastName: string;
    age: number;
}

const UserItem: React.FC<UserItemProps> = ({ id, userName, userLastName, age }) => {
    return (
        <div className="flex items-center justify-between p-10 text-xl">
            <div>{id}</div> 
            <div>{userLastName} {userName}</div>
            <div>{age} років</div>
        </div>
    );
};

export default UserItem;
